package db.domain;import java.util.Arrays;public class PvpTopsImpl implements PvpTops {	@Key	private int rank;	@Key	private String uname;	public PvpTopsImpl() {	}	public PvpTopsImpl(PvpTops c) {		this.rank = c.getRank();		this.uname = c.getUname();	}	@Override	public String tableName() {		return "pvp_tops";	}	public void setRank(int rank) {		this.rank = rank;	}	public int getRank() {		return this.rank;	}public void addRank(int rank) {		this.rank += rank;}	public void setUname(String uname) {		this.uname = uname;	}	public String getUname() {		return this.uname;	}public void addUname(String uname) {		this.uname += uname;}}